import React, { useEffect, useState } from "react";
import ProtectedRoute from "./../../Common/AppTools/ProtectedRoute";
import Historical from "./Historical";
import Parse from "parse";

const MainHistroical = () => {
  const [flag, setFlag] = useState(false);
  const [check, setCheck] = useState(false);

  useEffect(() => {
    if (Parse.User.current() === null) {
      setCheck(false);
    } else {
      setCheck(true);
    }
  }, [setCheck]);

  useEffect(() => {
    if (check === true) {
      console.log("Good")
      setFlag(true);
    } else {
      console.log("Bad")
      setFlag(false);
    }
  }, [check]);

  // In this case the flag is acquired through a check box but it could also be received from other methods
  // What is a Parse.User method that would help here?

  console.log(check);

  return (
    <div>
      <ProtectedRoute
        exact
        wantedPath="/historical"
        flag={flag}
        component={Historical}
      />
    </div>
  );
};

export default MainHistroical;
